export const getApps = () => new Promise((resolve, reject) => {
    const req = new Empty();
    const metadata = {'token': getToken()};
    cmsService.getAppList(req, metadata, (err, resp) => {
        if (!err) {
            const arr = []
            const list = resp.getAppsList()
            list.forEach((item, index)=>{
                const json = {
                    value : item.getId(),
                    label : item.getTitle(),
                    os : item.getOsType(),
                    isAnchor: item.getIsAnchor(),
