export function getArrName(arr, id){
    let label = ""
    arr.forEach((item) => {
        if(typeof(item.value) !== "undefined"){
            if(id.toString() === item.value.toString()){
                label = item.label
            }
        }

    })
    return label
}


export function getAppName(arr, id){
    let label = ""
    let os = 0
    arr.forEach((item) => {
        if(typeof(item.value) !== "undefined"){
            if(id.toString() === item.value.toString()){
                label = item.label
                os = item.os
            }
        }
    })
    return {label:label, os:os}
}



